import { Injectable } from '@angular/core';
import { Router } from "@angular/router";

@Injectable({
  providedIn: 'root'
})
export class TurnOnOrOffActiveIconService {

  constructor(private router: Router) { }

  isUrlHome(): boolean {
    return this.router.url === '/home';
  }

  isUrlSearch(): boolean {
    return this.router.url === '/search';
  }
}
